import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

import MainNavigation from './shared/components/Navigation/MainNavigation';
import Login from './Login';

import './App.css';

function App() {
  return (

    <Router> 
      <MainNavigation/>
      <main>
        <Switch>
          <Route path="/login" exact component={Login} />
        </Switch>
      </main>
    </Router>

  );
}

export default App;
